import React from 'react';
import Card from './Card';
import "../styles/main.css";

let images = ['/images/lyte.jpg', '/images/brat.jpg', '/images/eminem.jpg', '/images/icecube.jpg', '/images/snoop.jpg', '/images/missy.jpg', '/images/rakim.jpeg', '/images/nas.jpg', '/images/chance.webp', '/images/llcoolj.jpg', '/images/cardib.jpeg', '/images/ti.jpeg'];

function Main() {
    return (
        <div className="container">
            <div className="card-deck">

            </div>
            <div className="row row-cols-3">
                images.map(image => {
                    <Card src={image}/>
                })
            </div>
        </div>
    );
  }

  export default Main;
